INSERT INTO public.authors VALUES (13, 'Las Ratitas', '', 'Las Ratitas son dos hermanas, Gisele y Claudia, que siempre juegan y lo pasan bien. Seguramente las conocerás por su divertidísimo canal de YouTube, en el que cuentan con casi 20.000.000 de seguidores. Actualmente su canal Las Ratitas es el número 1 indiscutible de YouTube, con más seguidores que ningún otro en la categoría infantil en lengua española. Además, disponen de otro canal, SaneuB, con casi 6.000.000 de seguidores y otro familiar, Itarte Vlogs, con 5.000.000. ¡No te pierdas sus aventuras! Con ellas, la diversión y la magia están aseguradas.');
INSERT INTO public.authors VALUES (12, 'Elisabet
', 'Benavent', 'Elísabet Benavent es licenciada en Comunicación Audiovisual por la Universidad Cardenal Herrera CEU de Valencia, tras esa licenciatura se mudó a Madrid donde cursó el máster sobre Comunicación y Arte en la Universidad Complutense de Madrid, lugar donde actualmente reside la escritora.
Dice que su afición a la escritura surgió a una edad muy temprana, porque su hermana le inculcó el gusto a la lectura, pero no sabe exactamente cómo empezó a escribir, sólo sentía la necesidad de hacerlo.1​ Se la reconoce por el género de sus novelas romántico-contemporáneas como ella las llama.2​
Se alzó a la fama con la publicación de su primer libro En los zapatos de Valeria el 3 de enero de 2013 a través de una plataforma digital. Pocos meses después de la autopublicación en Internet, la Editorial Suma publicó la novela como primer libro de la saga "Valeria", que fue continuada por Valeria en el espejo (2013), Valeria en blanco y negro (2013), Valeria al desnudo (2013) y finalmente El diario de Lola (2015), donde narra la historia de Valeria y sus amigas en un viaje de la vida y el amor. La cifra de las ventas de la saga en la actualidad aumenta a más de 1.200.000 ejemplares. Gracias a este éxito, el 8 de mayo de 2020, Netflix estrenó la primera temporada de Valeria, una serie basada en estas novelas, protagonizada por Diana Gómez, Paula Malia, Silma López y Teresa Riott. Tras la gran acogida de la primera temporada, se ha confirmado la realización de una segunda.
');
INSERT INTO public.authors VALUES (7, 'Patrick', 'Rothfuss', 'Patrick Rothfuss nació en Madison, Wisconsin y se convirtió en un asiduo lector en parte debido al mal tiempo y a la carencia de televisión por cable.1​ Se matriculó en la Universidad de Wisconsi-Stevens Point en 1991. En la universidad originalmente planeaba estudiar ingeniería química, pero cambió de opinión al encontrarla poco afín a sí, y pasó los siguientes semestres estudiando cualquier asignatura que atrajera su interés. Después de nueve años en la universidad, se le pidió que invirtiera sus esfuerzos en graduarse, y Rothfuss terminó por salir con un título de filología inglesa. Durante esta época se dedicó a trabajar en diversos y extraños trabajos, y al mismo tiempo se dedicó a trabajar en una novela de fantasía extremadamente larga llamada The Song of Flame and Thunder.También comenzó a escribir la "Guía de Supervivencia en la Universidad" en una columna de The Pointer, el periódico del campus.​ Después de realizar un curso de profesor en la Universidad del estado de Washington regresó dos años después para dar clases en Stevens Point.​ Tras completar The Song of Flame and Thunder Rothfuss la envió a varias editoriales, pero fue rechazada. En el año 2002 ganó la competición Escritores del futuro con The Road to Levinshir, un extracto de su novela. A continuación Rothfuss vendió la novela a DAW Books. The Song of Flame and Thunder fue dividida en una serie de tres tomos titulada Crónica del asesino de reyes, con el primer tomo, El nombre del viento, publicado en abril del año 2007. La novela ganó ese año el Premio Quill a la mejor novela de fantasía/ciencia ficción,apareció en la lista de best sellers del New York Times5​y Amazon lo seleccionó entre sus diez «joyas ocultas» de 2007. El temor de un hombre sabio, la continuación de El nombre del viento, se publicó en marzo de 2011 en el mundo anglosajón. Debutó la primera semana de su lanzamiento en el n.º 1 de The New York Times y en el n.º 2 de The Times, y fue libro recomendado del mes en Amazon, donde era uno de los títulos más vendidos desde un mes antes de su publicación.​Actualmente Patrick Rothfuss está empezando a revisar la tercera entrega, provisionalmente titulada The Doors of Stone (Las puertas de piedra)
Por otra parte, Patrick Rothfuss lleva a cabo una campaña llamada Worldbuilders, que consiste en recaudar fondos destinados a la ONG Heifer International, dedicada a intentar acabar con el hambre y la pobreza en el mundo. A mediados de 2008, decidió organizar un concurso de fotografía en su blog y su página de Facebook. Lo que en su inicio estaba pensado como una forma de dar algún premio a los lectores acabó haciéndose enorme, con casi mil fotos en competición y cientos de participantes esperando los resultados. De modo que, a la hora de plantearse organizar un nuevo concurso, Patrick decidió que los premios podrían ir destinados a una buena causa. Así nació su iniciativa Worldbuilders (constructores de mundos), campaña que desde entonces ha vuelto a poner en práctica a finales de cada año.');
INSERT INTO public.authors VALUES (15, 'Miguel Angel', 'Revilla', 'Divorciado, está casado en segundas nupcias con Aurora Díaz Abella, leonesa natural de la comarca de El Bierzo. Tiene tres hijas, dos de su primer matrimonio.
Licenciado en Ciencias Económicas y Empresariales y diplomado en Banca y Bolsa por la Universidad del País Vasco, es empleado de banca en excedencia. Entre 1974 y 1982 dirigió la sucursal del Banco Atlántico en Torrelavega. Asimismo, de 1979 a 1982 fue profesor de Estructura Económica en la Escuela Superior de Dirección de Empresas de Santander, antes de acceder a la Universidad de Cantabria, donde ejerció como profesor asociado de Política Económica y Hacienda Pública hasta 1995.');
INSERT INTO public.authors VALUES (1, 'Karl', 'E. Wiegers', 'Karl E. Wiegers (nacido en 1953) es un ingeniero de software , consultor y entrenador estadounidense en las áreas de desarrollo de software, gestión y mejora de procesos. Es conocido como el autor de muchos artículos y varios libros centrados principalmente en los requisitos de software . También es autor de una memoria de lecciones de vida titulada Pearls from Sand: How Small Encounters Lead to Powerful Lessons y una novela de misterio titulada The Reconstruction.Karl recibió una licenciatura en química de Boise State College (1973), y MS (1975) y Ph.D. (1977) se graduó en química orgánica de la Universidad de Illinois. [1] Karl pasó 18 años, desde 1979 hasta 1998, en Eastman Kodak Company.
En 1997, Karl comenzó su propia empresa de consultoría y capacitación en procesos de software, Process Impact, que se enfoca en la mejora práctica de procesos de software. ');
INSERT INTO public.authors VALUES (16, 'Javier', 'Castillo', 'Asesor financiero, escribió su primera novela, El día que se perdió la cordura, en 2014,​ que fue publicada inicialmente en una plataforma electrónica; según manifestaciones del propio autor, «el día que acabé el libro imprimí cuatro ejemplares y los mandé a cuatro editoriales grandes, pero no quería esperar su respuesta y aquella misma noche lo subí a Kindle Direct Publishing».
El éxito de ventas en dicha plataforma llevó a varias editoriales a ofrecerle su edición, publicándose en papel en 2016 a través de la editorial Suma de Letras.​Su segunda novela se publicó el 11 de enero de 2018.');
INSERT INTO public.authors VALUES (4, 'Josh', 'Lockhart', 'Josh Lockhart creó Slim Framework , un popular micro framework PHP que permite el desarrollo rápido de aplicaciones web y API. Josh también comenzó y actualmente es curador de PHP The Right Way , una iniciativa popular en la comunidad de PHP que fomenta las buenas prácticas y difunde información de calidad para los desarrolladores de PHP de todo el mundo. Josh es desarrollador de NMC, una agencia de diseño web, desarrollo y marketing de servicio completo en Carrboro, Carolina del Norte, donde disfruta creando aplicaciones personalizadas con HTML, CSS, PHP, JavaScript, Bash y varios marcos de gestión de contenido. Josh se graduó en Ciencias de la Información y la Biblioteca.programa en la Universidad de Carolina del Norte en Chapel Hill en 2008. Actualmente reside en Chapel Hill, Carolina del Norte con su maravillosa esposa, Laurel, y sus dos perros. Puedes seguir a Josh en Twitter en https://twitter.com/codeguy , leer su blog en http://joshlockhart.com y seguir sus proyectos de código abierto en https://github.com/codeguy .');
INSERT INTO public.authors VALUES (10, 'Robin', 'Hard', 'Estudió griego en Aberystwyth y la Universidad de Reading, en la que es profesor de Filosofía Antigua  y Griego. Se dedica a la traducción del griego, y escribe sus propias obras sobre la mitología. Ha revisado la obra del canadiense H. J. Roses.');
INSERT INTO public.authors VALUES (2, 'Michael', 'C. Feathers', 'MICHAEL C. FEATHERS trabaja para Object Mentor, Inc., uno de los principales proveedores mundiales de servicios de mentoría, desarrollo de habilidades, transferencia de conocimiento y liderazgo en desarrollo de software. Actualmente proporciona capacitación y tutoría en todo el mundo en desarrollo basado en pruebas (TDD), refactorización, diseño OO, Java, C #, C ++ y programación extrema (XP). Michael es el autor original de CppUnit, un puerto C ++ del marco de prueba JUnit, y FitCpp, un puerto C ++ del marco de prueba integrado FIT. Miembro de ACM e IEEE, ha presidido CodeFest en tres conferencias de OOPSLA.');
INSERT INTO public.authors VALUES (6, 'George', 'R. R. Martin', 'Es el mayor de tres hermanos. Creció en una familia trabajadora, su padre era estibador de ascendencia italo-germana, y su madre, de ascendencia irlandesa. Desde la infancia se interesó por la lectura y se convirtió en un precoz escritor de relatos. Posteriormente cursó estudios universitarios de periodismo en la Northwestern University de Evanston (Illinois), donde se graduó en 1971. Tras terminar sus estudios, realizó la prestación social sustitutoria (es objetor de conciencia), dirigió torneos de ajedrez y trabajó como profesor de periodismo en el instituto Clarke de Dubuque, Iowa (1976-1978).
Fue un prolífico autor de obras cortas de ficción en los años 1970 y su obra fue premiada con varios premios Hugo y Nebula. Al final de esta década comenzó a publicar sus primeras novelas siendo una de las más populares la primera de ellas: Muerte de la luz (Dying of the Light, 1977). Dicho éxito le permitió dedicarse en exclusiva a la literatura, donde mezcla los géneros de ciencia ficción, fantasía y terror.');
INSERT INTO public.authors VALUES (11, 'Joy', 'Beatty', 'Joy Beatty es vicepresidenta de Seilevel. Joy implementa nuevas metodologías y mejores prácticas que mejoran la obtención y modelado de requisitos. Ella asesora a las compañías Fortune 500 mientras construyen centros de excelencia en análisis de negocios. Joy ha brindado capacitación a miles de analistas de negocios y cuenta con la certificación CBAP® y PMI-PBA®.
Joy participa activamente como líder en la comunidad de requisitos. Ella formó parte del equipo central que desarrolló la versión más reciente del Instituto de Análisis Empresarial (BABOK) del Instituto Internacional de Análisis Empresarial (IIBA), así como el Análisis Empresarial para Profesionales del Proyecto Management Institute (PMI): una guía práctica. Además, escribe sobre metodologías de requisitos en revistas, libros blancos y publicaciones de blog. Joy se graduó de la Universidad de Purdue con una licenciatura en ciencias de la computación y matemáticas. Es coautora de Modelos visuales para Requisitos de software, con el CEO de Seilevel, Anthony Chen, y Requisitos de software, 3a edición, con el famoso Karl Wiegers.');
INSERT INTO public.authors VALUES (3, 'Robert', 'C. Martin', 'Robert C. Martin ha sido un profesional del software desde 1970. En los últimos 35 años, ha trabajado en varias capacidades en literalmente cientos de proyectos de software. Es autor de libros "emblemáticos" sobre programación ágil, programación extrema, UML, programación orientada a objetos y programación C ++. Ha publicado docenas de artículos en varias revistas especializadas. Hoy, es una de las principales autoridades de la industria del software en el desarrollo de software ágil y es un orador habitual en conferencias y ferias comerciales internacionales. Es ex editor del Informe C ++ y actualmente escribe una columna mensual de Craftsman para la revista Software Development.
Martin es el fundador, CEO y presidente de Object Mentor Incorporated. Object Mentor es una compañía hermana de Object Mentor International. Al igual que OMI, Object Mentor está compuesto por profesionales de software altamente experimentados que brindan consultoría de mejora de procesos, consultoría de diseño de software orientado a objetos, capacitación y servicios de desarrollo a grandes corporaciones de todo el mundo.');
INSERT INTO public.authors VALUES (14, 'Juan', 'Gomez', 'Autor de novelas publicadas en más de cuarenta países, en el año 2011 y en el 2016, dos de sus novelas, El emblema del traidor y Cicatriz, fueron las más vendidas en formato electrónico, según publicó Amazon.​ En 2018 repitió con Reina Roja y en 2019 con Loba Negra.
Su primera novela publicada fue Espía de Dios (2006) y uno de los primeros libros publicados en libro electrónico, con la iniciativa de varios autores de 1libro1euro.
Su segunda novela fue Contrato con Dios (2007).
Su tercera novela, El emblema del traidor (2008), fue premiada en el VII Premio Internacional de Novela Ciudad de Torrevieja.
Ha publicado una saga de libros juveniles, Alex Colt.
Ha trabajado como periodista en diferentes mediosː Radio España, Canal +, Cadena COPE, 40 Principales, ABC,​ La Voz de Galicia, El Mundo8​4​ y ha colaborado con las revistas Qué Leer, Jot Down y New York Times Book Review.
Entre septiembre de 2014 y junio de 2018 realizó junto a Raquel Martos la sección "Personas físicas" del programa de Onda Cero Julia en la onda.

');
INSERT INTO public.authors VALUES (8, 'Damián', 'Mollá', 'Hijo de padre español y madre argentina, Damián Mollá nació en Madrid donde ha vivido siempre y en la ciudad que le ha dado su educación.
Finalmente terminó siendo guionista para varios programas de humor en televisión y radio, además de hacer monólogos y shows de humor por toda la geografía española.Su trayectoria como profesional dio inicio en 2002, participando en el programa de radio No somos nadie de M80 Radio. En esta emisora, estuvo aprendiendo y mejorando sus dotes radiofónicas hasta 2007, cuando dejó el programa para centrarse en el mundo de la televisión como guionista y colaborador del programa: El hormiguero, en el que llevaba trabajando desde 2006.
En este programa ha ido ganando cierta fama hasta el día de hoy, gracias a su actuación con la hormiga Barrancas, una de las dos mascotas del programa y a la que también da voz. Además ha colaborado como guionista en otros programas de renombre como El club de la comedia.
Es coautor de dos libros This Book is the Milk y This Book is the Re-Milk, que van dirigidos a todos los públicos y cuya misión es la de enseñar a hablar inglés, utilizando un humor muy característico. El autor con el que ha colaborado en la creación de los mismos, es Alberto Alonso.

');
INSERT INTO public.authors VALUES (5, 'Marcos', 'Chicot', 'Marcos Chicot Álvarez es licenciado en Psicología Clínica, Psicología Laboral y Económicas.
Escribió su primera novela Óscar en 1997. En 1998 obtuvo el Premio de Novela Francisco Umbral con la novela Diario de Gordon. En 2004 ganó el Premio Internacional Literario Rotary Club de novela juvenil. En 2013 fue finalista del Premio Planeta (cuarta posición) con el libro El asesinato de Pitágoras, publicado en 20 países, y que ese año fue el ebook en lengua española más vendido del mundo. Por esa misma novela, la ciudad de Crotona le otorgó la distinción Encomio Solenne (Alabanza Solemne), y también le fue concedido el Premio per la Cultura Mediterranea 2015 como reconocimiento a su labor de difusión cultural.
En 2014 publicó La Hermandad, y en 2016 logró el segundo puesto en el Premio Planeta1​ con su novela histórica El asesinato de Sócrates. A raíz de esta novela pronunció el discurso de graduación de la facultad de Filosofía de la Universidad Complutense de Madrid en 2017. En el año 2018, impartió el curso "El autor y su obra" en la Universidad Internacional Menéndez Pelayo.');
INSERT INTO public.authors VALUES (9, 'Alberto', 'Alonso', 'Alberto es una raza rara; Almericano: nacido de un padre español y una madre estadounidense en los Estados Unidos. Desde que tiene memoria, le ha encantado entretener a las personas y hacerlas reír. Luego recibió un BFA (Bachelor of Fine Arts) en teatro. Es un actor profesional en el sindicato AEA.
A lo largo de su larga carrera profesional, ha trabajado como director, escritor, actor, cantante, presentador, profesor, intérprete y artista de doblaje. También ha escrito los libros de éxito: inglés en todas partes, este libro es la leche y este libro es la leche, inglés sobre la marcha.
También ha aparecido en muchos programas populares de televisión y radio: El Hormiguero, Dani & Flo, English On The Go, RNE, La Ser, Cope, Melodia FM, etc.
Incansable y siempre en busca de nuevas aventuras, no conoce otra forma de ver la vida, excepto amarla y vivir cada momento al máximo. Sentirás esta energía en cada uno de mis programas, algunos de los cuales han estado en el aire durante aproximadamente una década. Echa un vistazo a sus últimos proyectos de medios en la página de inicio.');
INSERT INTO public.authors VALUES (17, 'Ken', 'Follett', 'Kenneth Martin Follett1​ (Cardiff, Gales; 5 de junio de 1949), más conocido como Ken Follett, es un escritor británico de novelas de suspense e históricas.Sus padres son Martin y Veenie, y vivió en su ciudad natal hasta que su familia se trasladó a Londres cuando él tenía diez años. Al prohibirle sus padres, cristianos devotos, ir al cine y ver la televisión, desarrolló un temprano interés por la lectura, pero fue un estudiante muy normal hasta que llegó a la adolescencia. En 1967 ingresó en la University College of London, donde estudió filosofía y se implicó en movimientos de izquierdas. Se casó con su primera esposa, Mary, en 1968.');


