INSERT INTO public.books VALUES (1, '', 'Requisitos de software - 2º Edición', '978-0735618794', 'Sin requisitos formales y verificables de software, y un sistema efectivo para administrarlos, los programas que los desarrolladores piensan que han acordado construir a menudo no serán los mismos productos que sus clientes esperan. En SOFTWARE REQUIREMENTS, Segunda edición, la autoridad de ingeniería de requisitos Karl Wiegers amplía las mejores prácticas presentadas en su texto original galardonado, ahora un pilar para cualquiera que participe en el proceso de desarrollo de software.

En este libro, descubrirá técnicas efectivas para administrar el proceso de ingeniería de requisitos durante todo el ciclo de desarrollo, incluidas docenas de técnicas para facilitar esa comunicación tan importante entre usuarios, desarrolladores y administración. Esta edición actualizada presenta nuevos ejemplos de casos, anécdotas extraídas de la extensa carrera de consultoría del autor y Próximos Pasos específicos para poner en práctica los principios de mejora de procesos del libro. También encontrará varios capítulos nuevos, documentos de muestra y una guía incisiva de solución de problemas.
', '2003-03-08');
INSERT INTO public.books VALUES (2, '', 'Working Effectively with Legacy Code', '978-0131177055', '¿Es fácil cambiar su código? ¿Puedes obtener comentarios casi instantáneos cuando lo cambias? ¿Tú lo entiendes? Si la respuesta a cualquiera de estas preguntas es no, tiene un código heredado, y le está quitando tiempo y dinero a sus esfuerzos de desarrollo.

En este libro, Michael Feathers ofrece estrategias de principio a fin para trabajar de manera más efectiva con bases de código heredadas grandes y no probadas. Este libro se basa en el material que Michael creó para sus reconocidos seminarios de Object Mentor: técnicas que Michael ha utilizado en la tutoría para ayudar a cientos de desarrolladores, gerentes técnicos y evaluadores a controlar sus sistemas heredados.

Los temas cubiertos incluyen

Comprender la mecánica del cambio de software: agregar funciones, corregir errores, mejorar el diseño, optimizar el rendimiento
Obtener código heredado en un arnés de prueba
Escribir exámenes que lo protejan contra la introducción de nuevos problemas
Técnicas que se pueden usar con cualquier lenguaje o plataforma, con ejemplos en Java, C ++, C y C #
Identificar con precisión dónde deben realizarse cambios en el código
Hacer frente a sistemas heredados que no están orientados a objetos
Manejo de aplicaciones que no parecen tener ninguna estructura.
Este libro también incluye un catálogo de veinticuatro técnicas de ruptura de dependencia que lo ayudan a trabajar con elementos del programa de manera aislada y hacer cambios más seguros.', '2004-09-22');
INSERT INTO public.books VALUES (7, '', 'El Nombre del Viento', 'B006BD4C2W', 'En una posada en tierra de nadie, un hombre se dispone a relatar, por primera vez, la auténtica historia de su vida. Una historia que únicamente él conoce y que ha quedado diluida tras los rumores, las conjeturas y los cuentos de taberna que le han convertido en un personaje legendario a quien todos daban ya por muerto: Kvothe... músico, mendigo, ladrón, estudiante, mago, héroe y asesino.

Ahora va a revelar la verdad sobre sí mismo. Y para ello debe empezar por el principio: su infancia en una troupe de artistas itinerantes, los años malviviendo como un ladronzuelo en las calles de una gran ciudad y su llegada a una universidad donde esperaba encontrar todas las respuestas que había estado buscando.

«Viajé, amé, perdí, confié y me traicionaron.»

«He robado princesas a reyes agónicos. Incendié la ciudad de Trebon. He pasado la noche con Felurian y he despertado vivo y cuerdo. Me expulsaron de la Universidad a una edad a la que a la mayoría todavía no los dejan entrar. He recorrido de noche caminos de los que otros no se atreven a hablar ni siquiera de día. He hablado con dioses, he amado a mujeres y he escrito canciones que hacen llorar a los bardos.

»Me llamo Kvothe. Quizá hayas oído hablar de mí.»', '2011-11-18');
INSERT INTO public.books VALUES (5, '', 'El Asesinato de Sócrates', 'B07JD7YMV8', 'Un oscuro oráculo vaticina la muerte de Sócrates.
Un recién nacido es condenado a morir por su propio padre.
Una guerra encarnizada entre Atenas y Esparta desangra Grecia.

El Asesinato de Sócrates recrea magistralmente la época más extraordinaria de nuestra historia. Madres que luchan por sus hijos, amores imposibles y soldados tratando de sobrevivir se entrelazan de un modo fascinante con los artistas, gobernantes y pensadores que convirtieron Grecia en la cuna de nuestra civilización. A lo largo de las páginas de esta absorbente novela, brilla con luz propia la figura inigualable de Sócrates, el hombre cuya vida y muerte nos inspiran desde hace siglos, el filósofo que marca un antes y un después en la historia de la humanidad.', '2016-12-23');
INSERT INTO public.books VALUES (13, '', 'El Caballero de los Siete Reinos', '8417507213', 'Las andanzas de un caballero de Poniente Los tres primeros relatos de Dunk y Egg Muchas son las historias que se cuentan sobre Aegon V el Improbable y ser Duncan el Alto, su leal comandante de la Guardia Real. Pero la magia y la épica de la leyenda esconden la verdadera naturaleza de los héroes: la determinación de un huérfano del Lecho de Pulgas que llegó a caballero, el arrojo de un príncipe que cambió la corte por los caminos y una amistad inquebrantable capaz de vencer intrigas, traiciones... y revueltas. Durante los reinados de Daeron II y Aerys I, cuando las heridas de la rebelión de los Fuegoscuro todavía estaban abiertas, tienen lugar las primeras aventuras de un caballero fornido y bonachón y de su escudero, un infante real, fiel y de fuerte temperamento. A medio camino entre la fantasía heroica y la novela de caballerías, El caballero de los Siete Reinos narra las peripecias de dos héroes bondadosos en una tierra despiadada. «En la tradición epicofantástica, Martin es el mejor con diferencia.» Time Magazine', '1998-08-25');
INSERT INTO public.books VALUES (8, '', 'Modern PHP
', 'B00TKVLL26', 'PHP está experimentando un renacimiento, aunque puede ser difícil saberlo con todos los tutoriales PHP obsoletos en línea. Con esta guía práctica, aprenderá cómo PHP se ha convertido en un lenguaje maduro con todas las funciones con orientación a objetos, espacios de nombres y una creciente colección de bibliotecas de componentes reutilizables.
El autor Josh Lockhart, creador de PHP The Right Way, una iniciativa popular para fomentar las mejores prácticas de PHP, revela estas nuevas características del lenguaje en acción. Aprenderá las mejores prácticas para la arquitectura y planificación de aplicaciones, bases de datos, seguridad, pruebas, depuración e implementación. Si tienes un conocimiento básico de PHP y quieres reforzar tus habilidades, este es tu libro.
Aprenda las características modernas de PHP, como espacios de nombres, rasgos, generadores y cierres
Descubre cómo encontrar, usar y crear componentes PHP
Siga las mejores prácticas para la seguridad de las aplicaciones, trabaje con bases de datos, errores y excepciones, y más
Aprenda herramientas y técnicas para implementar, ajustar, probar y perfilar sus aplicaciones PHP
Explore las implementaciones de lenguaje HVVM y Hack de Facebook, y cómo afectan el PHP moderno
Cree un entorno de desarrollo local que coincida estrechamente con su servidor de producción', '2015-02-16');
INSERT INTO public.books VALUES (10, '', 'Canción de fuego y hielo
', 'B007B5EDEG', 'La serie Canción de hielo y fuego de George R. R. Martin ha establecido el punto de referencia para la fantasía épica contemporánea. Etiquetado por la revista Time como una de las 100 personas más influyentes del mundo, Martin ha conjurado un mundo tan complejo y vibrante como el de J.R.R. Tolkien, poblado por un enorme elenco de personajes fascinantes y complejos, y con una historia que se remonta a doce mil años.
Tres grandes historias se tejen a través de los libros, trazando la guerra civil por el control de los Siete Reinos; la defensa del imponente Muro de hielo en el extremo norte contra la amenaza sobrenatural de los Otros; y al otro lado del Mar Estrecho, el ascenso al poder de Daenerys Targaryen y los últimos dragones vivos del mundo.', '2012-03-15');
INSERT INTO public.books VALUES (9, '', 'Juego de Tronos', 'B000QCS8TW', 'Viene el invierno. Tal es el lema severo de la Casa Stark, el feudo más septentrional que debe lealtad al Rey Robert Baratheon en el lejano Desembarco del Rey. Allí Eddard Stark de Winterfell gobierna en nombre de Robert. Allí su familia habita en paz y comodidad: su orgullosa esposa, Catelyn; sus hijos Robb, Brandon y Rickon; sus hijas Sansa y Arya; y su hijo bastardo, Jon Snow. Lejos al norte, detrás del imponente Muro, se encuentran salvajes Wildings y cosas peores: cosas antinaturales relegadas al mito durante el verano de siglos, pero demostrando ser demasiado reales y demasiado mortales en el cambio de estación.
Sin embargo, una amenaza más inmediata acecha al sur, donde Jon Arryn, la Mano del Rey, ha muerto en circunstancias misteriosas. Ahora Robert cabalga hacia el norte, hacia Winterfell, trayendo a su reina, el encantador pero frío Cersei, su hijo, el cruel y vanabundo Príncipe Joffrey, y los hermanos de la reina Jaime y Tyrion de la poderosa y rica Casa Lannister, el primero un espadachín sin igual, el segundo, un enano cuya baja estatura oculta una mente brillante. Todos se dirigen a Invernalia y un encuentro fatídico que cambiará el curso de los reinos.
Mientras tanto, al otro lado del Mar Estrecho, el Príncipe Viserys, heredero de la Casa Targaryen caída, que una vez gobernó a todos los Westeros, planea reclamar el trono con un ejército de bárbaros Dothraki, cuya lealtad comprará en la única moneda que le queda: su hermosa pero inocente hermana, Daenerys.', '2003-01-01');
INSERT INTO public.books VALUES (12, '', 'This Book is the Milk!', '8415978960', '¿Odias el inglés? ¿Llevas estudiando inglés toda tu vida y no consigues aprenderlo? Pues escucha: este libro es para ti.
Este es un libro para pasarlo bien; reírse, descubrir cosas nuevas y engancharse, pero no sólo eso, es mucho más. En inglés hay muchas cosas que sabes, el problema es que no sabes que las sabes. Por ejemplo: ¿sabes decir ‘copo de nieve’? Quizá creas que no lo sabes, pero sí lo sabes. Sabes que “corn flakes” son ‘copos de maíz’, los has comido y pronunciado mil veces. Entonces si “corn” es ‘maiz’ y “flakes” son ‘copos’, ¿Cómo se dice ‘copo de nieve’? Claro, ¡¡“Snowflake”!! Esta manera de presentar las palabras consigue algo muy importante, grabarlas en tu cerebro de manera que no las volverás a olvidar. Este proceso lo hacemos con más de 2.000 términos y expresiones.
Para aprender un idioma no sirve con conocer una palabra, hay que dominarla, y conseguirlo no siempre es fácil. Con This book is the milk! conseguirás este efecto y todo lo que te presentamos pasará a formar parte de tu inglés activo.
This book is the milk! es un libro realizado por Alberto Alonso (presentador de radio y televisión de programas como English on the go y The show with no name en Vaughan) y Damián Mollá (colaborador del programa El hormiguero, Antena 3). Un libro para aquellos que quieren aprender inglés y divertirse al mismo tiempo. ¡Disfrutarás!', '2013-11-20');
INSERT INTO public.books VALUES (21, '', 'La chica de nieve', '8491292667', 'Nueva York, 1998, cabalgata de Acción de Gracias.
Kiera Templeton, de tan solo tres años, desaparece entre la multitud.
Tras una búsqueda frenética por toda la ciudad, alguien encuentra unos mechones de pelo junto a la ropa que llevaba puesta la pequeña.
En 2003, el día que hubiese sido el octavo cumpleaños de Kiera, sus padres, Aaron y Grace Templeton, reciben en casa un extraño paquete con algo inesperado: una cinta de vídeo VHS con una grabación de un minuto de Kiera, ya con ocho años, jugando en una habitación desconocida.
Miren Triggs, una estudiante de periodismo de la Universidad de Columbia, se siente atraída por el caso e inicia una investigación paralela que la lleva a desentrañar aspectos de su pasado que creía olvidados, y es que su historia personal, al igual que la de Kiera, está llena de incógnitas.', '2020-03-12');
INSERT INTO public.books VALUES (14, '', 'Código Limpio', '8441532109', 'Cada año, se invierten innumerables horas y se pierden numerosos recursos debido a código mal escrito, ralentizando el desarrollo, disminuyendo la productividad, generando graves fallos e incluso pudiendo acabar con la organización o empresa. El reconocido experto de software Robert C. Martin, junto con sus colegas de Object Mentor, nos presentan sus óptimas técnicas y metodologías ágiles para limpiar el código sobre la marcha y crearlo de forma correcta, de este modo mejorará como programador. Esta obra se divide en tres partes. La primera describe los principios, patrones y prácticas para crear código limpio. La segunda incluye varios casos de estudio cuya complejidad va aumentando. Cada ejemplo es un ejercicio de limpieza y transformación de código con problemas. La tercera parte del libro contiene una lista de heurística y síntomas de código erróneo (smells) confeccionada al crear los casos prácticos. El resultado es una base de conocimientos que describe cómo pensamos cuando creamos, leemos y limpiamos código. Imprescindible para cualquier desarrollador, ingeniero de software, director de proyectos, jefe de equipo o analista de sistemas interesado en crear código de mejor calidad. ¡El libro que todo programador debe leer!', '2008-08-01');
INSERT INTO public.books VALUES (15, '', 'El Asesinato de Pitágoras', '8416634645', 'El anciano filósofo Pitágoras, uno de los personajes con más poder político de su época, está a punto de nombrar un sucesor entre sus grandes maestros cuando en su comunidad se inicia una serie de asesinatos. Cada muerte tiene lugar de un modo más desconcertante e imprevisible, reflejando tras ellas una mente oscura y poderosa que parece superar a la del mismísimo Pitágoras. La enigmática Ariadna y el investigador egipcio Akenón tratarán de identificar al asesino a la vez que resuelven sus propios sentimientos. Un reto en el que los fantasmas del pasado se unen a las oscuras amenazas del presente. Un desafío del que resulta casi imposible salir con vida.', '2013-01-01');
INSERT INTO public.books VALUES (16, '', 'El Temor de un Hombre Sabio', '8499899617', '«Todo hombre sabio teme tres cosas: la tormenta en el mar, la noche sin luna y la ira de un hombre amable.»
El hombre había desaparecido. El mito no. Músico, mendigo, ladrón, estudiante, mago, trotamundos, héroe y asesino, Kvothe había borrado su rastro. Y ni siquiera ahora que le han encontrado, ni siquiera ahora que las tinieblas invaden los rincones del mundo, está dispuesto a regresar. Pero su historia prosigue, la aventura continúa, y Kvothe seguirá contándola para revelar la verdad tras la leyenda.', '2011-03-01');
INSERT INTO public.books VALUES (17, '', 'El Gran Libro de la Mitología Griega', '8497349016', 'Los personajes, las historias y los temas de la mitología griega son, probablemente, el legado más importante de la antigua Grecia. Robin Hard hace en este libro un completo recorrido por el mismo, desde los orígenes del Caos y la Noche. Describe las leyendas de los hijos de Cronos y los primeros mitos populares que surgieron de la conciencia griega; continúa con la guerra con los Titanes y describe todas las aventuras de los dioses del Olimpo, así como las actividades y asociaciones de cada dios y diosa, y las de todos los dioses menores y deidades extranjeras relacionadas con ellos. Sin olvidar las historias de los héroes: Heracles, Teseo, Cadmo, Edipo, Jasón y los argonautas… y, sobre todo, los protagonistas de la guerra de Troya.
El autor se basa en el Manual de mitología griega de H. J. Rose, publicado por primera vez en 1928, hasta ahora el libro más accesible sobre mitología griega. Ha reescrito y revisado completamente el antiguo texto y añadido las conclusiones de las últimas investigaciones. El resultado es esta obra que presenta un completo y sistemático desarrollo de la compleja masa de leyendas, acompañado de numerosas citas de los autores clásicos, mapas, árboles genealógicos e ilustraciones que dan vida a los relatos. Un gran libro destinado a convertirse en el referente mundial sobre el tema.', '1929-01-01');
INSERT INTO public.books VALUES (22, '', 'El día que se perdió el amor', '8466347399', 'A las doce de la mañana del 14 de diciembre, una joven llena de magulladuras se presenta desnuda en las instalaciones del FBI de Nueva York con varias notas amarillentas en la mano. El inspector Bowring, jefe de la Unidad de Criminología, intentará descubrir qué oculta la joven y su conexión con otro caso, el de una mujer que aparece decapitada horas más tarde y cuyo nombre coincide con el que estaba escrito en una de las notas. A medida que avance en la investigación se dará cuenta de que este caso abre antiguas heridas difíciles de cicatrizar.', '2020-04-08');
INSERT INTO public.books VALUES (23, '', 'Loba negra', '8466666494', 'SEGUIR VIVA
Antonia Scott no tiene miedo a nada. Solo a sí misma.
NUNCA FUE
Pero hay alguien más peligroso que ella. Alguien que podría vencerla.
TAN DIFÍCIL
La Loba negra está cada vez más cerca. Y Antonia, por primera vez, está asustada.
Antonia Scott se enfrenta por fin a una rival a su altura la Loba Negra en este thriller continuación de Reina Roja. ', '2019-10-24');
INSERT INTO public.books VALUES (18, '', 'Tres, dos, uno... ¡superpoderes!', '840822574X', 'Las Ratitas son dos hermanas, Gisele y Claudia, que siempre juegan y lo pasan bien. Seguramente las conocerás por su divertidísimo canal de YouTube, en el que cuentan con casi 20.000.000 de seguidores. Actualmente su canal Las Ratitas es el número 1 indiscutible de YouTube, con más seguidores que ningún otro en la categoría infantil en lengua española. Además, disponen de otro canal, SaneuB, con casi 6.000.000 de seguidores y otro familiar, Itarte Vlogs, con 5.000.000. ¡No te pierdas sus aventuras! Con ellas, la diversión y la magia están aseguradas.', '2020-05-19');
INSERT INTO public.books VALUES (19, '', 'Reina roja', '8466664416', 'Antonia Scott es una mujer muy especial. Tiene un don que es al mismo tiempo una maldición: una extraordinaria inteligencia. Gracias a ella ha salvado decenas de vidas, pero también lo ha perdido todo. Hoy se parapeta contra el mundo en su piso casi vacío de Lavapiés, del que no piensa volver a salir. Ya no queda nada ahí fuera que le interese lo más mínimo.', '2018-11-08');
INSERT INTO public.books VALUES (20, '', '¿Por qué no nos queremos?', '846705669X', 'España ha cambiado muy positivamente en los últimos cuarenta años. Por más que haya recalcitrantes para quienes cualquier tiempo pasado fue mejor, la realidad es justo la contraria: vamos camino de ser los que más vivimos, y con una excelente calidad de vida, tenemos un idioma común que hablan 600 millones de personas, una extraordinaria sanidad pública universal y gratuita, una gastronomía única, somos una potencia turística mundial, estamos dotados de unas magníficas infraestructuras, nos encontramos entre los más solidarios del mundo, nuestra transición democrática fue ejemplar, sin embargo, ¿qué pasa? ¿Por qué somos tan cainitas, tan autodestructivos? ¿Por qué tenemos tan mala opinión de nosotros mismos? Ahí están el problema catalán, la corrupción, la escasa credibilidad de los políticos, la lacra de las casas de apuestas, el drama de la despoblación rural o el comunicado del rey Felipe VI por el que renunciaba a la herencia de su padre y le retiraba su asignación económica. Miguel Ángel Revilla analiza todos estos temas en ¿Por qué no nos queremos? y lo hace como siempre, sin morderse la lengua y poniendo nombres y apellidos, pese a quien pese, porque «a mis setenta y siete años paso de casi todo, salvo de la necesidad de estar tranquilo con mi conciencia». El libro incluye un capítulo dedicado a la crisis del coronavirus, que ha provocado en España la muerte de miles de personas.', '2020-06-02');
INSERT INTO public.books VALUES (24, '', 'Un cuento perfecto', '8491291911', ' Un ataque de pánico en un día bastante señalado hará que Margot (como la llaman sus hermanas Candela y Patricia) se calce sus Nike y salga corriendo. Comenzará así un viaje en el que aprenderá la ''sencilla'' tarea de ser ella misma.', '2020-02-20');
INSERT INTO public.books VALUES (26, '', 'La caída de los gigantes', '8499899803', 'La historia empieza en 1911, el día de la coronación del rey Jorge V en la abadía de Westminster. El destino de los Williams, una familia minera de Gales, está unido por el amor y la enemistad al de los Fitzherbert, aristócratas y propietarios de las minas. Lady Maud Fitzherbert se enamorará de Walter von Ulrich, un joven espía en la embajada alemana en Londres. Sus vidas se entrelazarán con la de un asesor progresista del presidente de Estados Unidos, Woodrow Wilson, y la de dos hermanos rusos a los que la guerra y la revolución les ha arrebatado su sueño de buscar fortuna en América.

Desde Washington hasta San Petesburgo, desde la inmundicia y los peligros de las minas de carbón hasta los candelabros lujosos de los palacios de la aristocracia, pasando por los pasillos de la Casa Blanca y el parlamento de Westminster, Ken Follet nos ofrece, en su novela más ambiciosa, un esmerado retrato de una época y de las pasiones que espolearon la vida de sus personajes.', '2013-03-07');
INSERT INTO public.books VALUES (25, '', 'La jungla de los listos', '8467045485', 'Es cierto que la recesión económica ha terminado. Los que la desataron, los poderes financieros, los ricos que no pagan, los que tienen los dineros en paraísos fiscales, en suma, la jungla de los listos, han dicho basta. Ya han puesto a la mayoría de la población en su sitio, es decir, plebe a su servicio. Ya tienen mano de obra barata haciendo cola y terrenos, inmuebles y empresas a mitad de precio.

Efectivamente, tienen razón Rajoy, De Guindos, Montoro y demás voceros. La recesión ha terminado. A la jungla de los listos no le interesa depauperarnos más porque le puede resultar peligroso. Ellos ya han conseguido hacerse mucho más ricos y poderosos.
Pero una cosa es que la economía no siga cayendo y otra muy distinta que tengamos a corto plazo un crecimiento que alivie el drama de la mayoría de los españoles.
', '2015-09-01');
INSERT INTO public.books VALUES (11, '', 'Tormenta de espadas', 'B004P1JEWU', 'Los Siete Reinos están divididos por revueltas y enemistades, y el invierno se acerca como una bestia enojada. Más allá de las fronteras del norte, los salvajes abandonan sus aldeas para reunirse en el páramo de hielo y piedra de los Colmillos de Hielo. A partir de ahí, el hermano renegado Mance Rayder los llevará al sur hacia el Muro.
Los hombres de la Guardia Nocturna están listos para el resfriado y los cadáveres que viajan con él. Pero ahora se enfrentan a una horda de salvajes de veinte mil personas fuertes y hambrientas inmersas en la magia oscura del desierto encantado, a punto de invadir el Reino del Norte, donde Robb Stark lleva su corona recién forjada.
Pero las defensas de Robb están alineadas contra el ataque desde el sur, la tierra de los enemigos de la Casa Stark, los Lannisters. Sus hermanas están atrapadas allí, muertas o probablemente muertas, a voluntad del rey-niño Joffrey de Lannister o su depravada madre Cersei, regente del Trono de Hierro. La ambición de Cersei no tiene restricciones mientras el enano Tyrion Lannister lucha por su vida, víctima de una traición.
Y al otro lado del océano, el último de los Targaryen cría los dragones que tramó de la pira funeraria de su marido. Daenerys Stormborn regresará a la tierra de su nacimiento para vengar el asesinato de su padre, el último Rey Dragón en el Trono de Hierro.', '2011-02-24');
INSERT INTO public.books VALUES (27, '', 'El invierno del mundo', ' 8490328153', 'En el año 1933, Berlín es un foco de agitación política y social. Lady Maud, ahora la esposa de Walter von Ulrich y madre de dos hijos, publica en una revista semanal artículos que ridiculizan al Partido Nazi, mientras que Walter manifiesta su oposición en el Parlamento. Sin embargo, parece que nada podrá frenar el poder ascendente del canciller Adolf Hitler. Cuando Ethel Williams y su hijo Lloyd visitan a la familia von Ulrich, todos serán testigos de la tiranía y la represión de la nueva Alemania.
El dominio del Tercer Reich se extenderá hasta Francia y más allá de la frontera rusa. Mientras, en Inglaterra, Lloyd Williams, activista político como su madre, luchará en el ejército británico para intentar frenar el avance de los nazis y se alistará en las brigadas internacionales durante la guerra civil española. Participará en la ofensiva de Zaragoza y la batalla de Belchite.
En Ty Gwyn, la mansión familia de los Fitzherbert en Gales, se alojarán los oficiales británicos y, durante su estancia, el teniente Lloyd Williams se sentirá atraído por la mujer de Boy Fitzherbert, la rica heredera americana Daisy Peshkov.', '2014-05-08');
INSERT INTO public.books VALUES (3, '', 'Arquitectura limpia', '978-0134494166', 'Sobre la base del éxito de los best sellers The Clean Coder y Clean Code, el legendario artesano del software Robert C. "Tío Bob" Martin muestra cómo aportar mayor profesionalismo y disciplina a la arquitectura y diseño de aplicaciones. Al igual que con sus otros libros, Martin''s Clean Architecture no solo presenta múltiples opciones y opciones, y dice "usa tu mejor criterio": te dice qué opciones tomar y por qué esas elecciones son críticas para tu éxito. Martin ofrece respuestas directas y sin sentido a preguntas clave de arquitectura y diseño como: ¿Cuáles son las mejores estructuras de alto nivel para diferentes tipos de aplicaciones, incluyendo web, base de datos, cliente grueso, consola y aplicaciones integradas? ¿Cuáles son los principios básicos de la arquitectura de software? ¿Cuál es el papel del arquitecto y qué está tratando de lograr realmente? ¿Cuáles son los principios básicos del diseño de software? ¿Cómo salen mal los diseños y arquitecturas, y qué puedes hacer al respecto? ¿Cuáles son las disciplinas y prácticas de arquitectos y diseñadores profesionales? Clean Architecture es una lectura esencial para cada arquitecto de software, analista de sistemas, diseñador de sistemas y gerente de software, y para cualquier programador que aspire a estos roles o que se vea afectado por su trabajo.
', '2017-09-20');
INSERT INTO public.books VALUES (6, '', 'Fuego y Sangre', 'B07FN6GLZ3', 'El nuevo libro de George R. R. Martin narra la fascinante historia de los Targaryen, la dinastía que reinó en Poniente trescientos años antes del inicio de "Canción de hielo y fuego", la saga que inspiró la serie de HBO: Juego de tronos.
Siglos antes de que tuvieran lugar los acontecimientos que se relatan en "Canción de hielo y fuego", la casa Targaryen, la única dinastía de señores dragón que sobrevivió a la Maldición de Valyria, se asentó en la isla de Rocadragón.
Aquí tenemos el primero de los dos volúmenes en el que el autor de Juego de tronos nos cuenta, con todo lujo de detalles, la historia de tan fascinante familia: empezando por Aegon I Targaryen, creador del icónico Trono de Hierro, y seguido por el resto de las generaciones de Targaryens que lucharon con fiereza por conservar el poder, y el trono, hasta la llegada de la guerra civil que casi acaba con ellos.
¿Qué pasó realmente durante la Danzade dragones? ¿Por qué era tan peligroso acercarse a Valyria después de la Maldición? ¿Cómo era Poniente cuando los dragones dominaban los cielos? Estas, y otras muchas, son las preguntas a las que responde esta monumental crónica, narrada por un culto maestre de la Ciudadela, que anticipa el ya conocido universo de George R.R. Martin.
Fuego y Sangre brindará a los lectores la oportunidad de tener otra visión de la fascinante historia de Poniente. Esta obra, magníficamente ilustrada con 85 láminas inéditas de Doug Wheatley, se convertirá, sin duda, en una lectura ineludible para todos los fans de la aclamada serie.', '2018-11-20');
INSERT INTO public.books VALUES (4, '', 'Software Requirements - 3º Edition', 'B00JDMPMOA', 'Ahora en su tercera edición, esta guía clásica de ingeniería de requisitos de software se ha actualizado completamente con nuevos temas, ejemplos y orientación. Dos líderes en la comunidad de requisitos se han unido para ofrecer un conjunto contemporáneo de prácticas que cubren toda la gama de actividades de desarrollo y gestión de requisitos en proyectos de software.
Describe técnicas prácticas, efectivas y probadas en el campo para gestionar el proceso de ingeniería de requisitos de principio a fin.
Proporciona ejemplos que demuestran cómo los requisitos "buenas prácticas" pueden conducir a menos solicitudes de cambio, mayor satisfacción del cliente y menores costos de desarrollo.
Completamente actualizado con ejemplos contemporáneos y muchas prácticas y técnicas nuevas.
Describe cómo aplicar prácticas de requisitos efectivas a proyectos ágiles y muchas otras situaciones especiales de proyectos.
Dirigido a analistas de negocios, desarrolladores, gerentes de proyectos y otras partes interesadas del proyecto de software que tienen una comprensión general del proceso de desarrollo de software.
Comparte las ideas obtenidas de la amplia experiencia de los autores al ofrecer cientos de cursos de capacitación, presentaciones y seminarios web sobre requisitos de software.
Se incluyen nuevos capítulos sobre la especificación de requisitos de datos, la escritura de requisitos funcionales de alta calidad y la reutilización de requisitos. Se ha agregado una profundidad considerable a los requisitos comerciales, las técnicas de obtención y los requisitos no funcionales. Además, los nuevos capítulos recomiendan prácticas de requisitos efectivas para diversas situaciones de proyectos especiales, que incluyen mejoras y reemplazos, soluciones empaquetadas, tercerización, automatización de procesos comerciales, análisis e informes, y proyectos de sistemas integrados y otros en tiempo real.', '2013-08-15');


