INSERT INTO public.reviews VALUES (22, NULL, 3, 'Una vez leído uno de los libros de la saga de Ken Follet, los personajes son viejos conocidos. A veces si no son de la saga también. De todas formas, es interesante para tener un punto de vista de los acontecimientos de la época que relata, con el que puedes o no estar de acuerdo, pero al menos parece sincero en sus exposiciones, siempre cargando la balanza hacia aquellos que él considera los buenos.', true, '2018-11-13 15:19:38', 27, 'Angela');
INSERT INTO public.reviews VALUES (15, NULL, 4, 'Te engancha desde la primera página. La trama está perfectamente trazada para que siempre te sorprenda. Si te gusta el thriller, imprescindible.', true, '2020-06-28 12:30:57', 23, 'Angel');
INSERT INTO public.reviews VALUES (5, '2020-07-15 13:12:26', 5, 'Después de leer este libro pase de ser programadora junior a senior y pasado mañana voy a tener una entrevista para ser arquitecta de software.
